import React from 'react';
import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";
import SchoolIcon from "@mui/icons-material/School";
import WorkIcon from "@mui/icons-material/Work";
import '../styles/Experience.css';

const Experience = () => {
  return ( 
  <div className='exp'>
    <div id='stars'></div>
    <div id='stars2'></div>
    <div id='stars3'></div>
    <VerticalTimeline className='line' lineColor="white">
        <VerticalTimelineElement
          className="vertical-timeline-element--education"
          contentStyle={{ background: 'white', color: 'radial-gradient(ellipse at bottom,#1b2735 0,#090a0f 100%)' }}
          contentArrowStyle={{ borderRight: '7px solid  rgb(33, 150, 243)' }}
          date="2019 - 2023"
          iconStyle={{ background: "#3e497a", color: "#fff" }}
          icon={<SchoolIcon />}
        >
          <h3 className="vertical-timeline-element-title edu">
            Netaji Subhas University of Technology, New Delhi, India
          </h3>

          <h4 className="vertical-timeline-element-subtitle quali">
            Bachelor's Degree
          </h4>
          <p className='degree'> Mechanical Engineering</p>
        </VerticalTimelineElement>
        <VerticalTimelineElement
          className="vertical-timeline-element--work"
          date="Jun,2022 - Sep,2022"
          iconStyle={{ background: "#e9d35b", color: "#fff" }}
          icon={<WorkIcon />}
        >
          <h3 className="vertical-timeline-element-title">
            Software Developer Intern - Jobs Territory
          </h3>
          <h4 className="vertical-timeline-element-subtitle">
            Bengaluru, India
          </h4>
          <p>
            Contributed in bulding their website and other features.
          </p>
        </VerticalTimelineElement>
      </VerticalTimeline>
    </div>
  )
}

export default Experience;
